// src/components/OrderHistoryPane.tsx (‰øÆÊ≠£Âæå)

import React from "react";
import { Order, OrderItem } from "../types";

interface OrderHistoryPaneProps {
  pendingOrders: Order[]; // Êú™‰ºöË®à„ÅÆÁ¢∫ÂÆöÊ∏à„ÅøÊ≥®Êñá„É™„Çπ„Éà
  orderHistoryTotalAmount: number; // Á¢∫ÂÆöÊ∏à„ÅøÊ≥®Êñá„ÅÆÂêàË®àÈ°ç
  onGoToPaymentView: () => void; // „Åä‰ºöË®àÈÅ∏ÊäûÁîªÈù¢„Å∏ÈÅ∑Áßª„Åô„Çã„Éè„É≥„Éâ„É©
  onCallStaff: () => void;
}

const OrderHistoryPane: React.FC<OrderHistoryPaneProps> = ({
  pendingOrders,
  orderHistoryTotalAmount,
  onGoToPaymentView,
  onCallStaff,
}) => {
  const isReadyToPay = pendingOrders.length > 0;

  return (
    // CSS„ÇØ„É©„Çπ 'history-pane-layout' „Å´„Çà„ÇäÂ∑¶Âè≥ÂàÜÂâ≤„Åï„Çå„Çã
    <div className="history-pane-layout">
      {/* Â∑¶ÂÅ¥: Â±•Ê≠¥„É™„Çπ„Éà (CSS„ÇØ„É©„Çπ 'history-content-main' „Åß„Çπ„ÇØ„É≠„Éº„É´ÂèØËÉΩ„Å´) */}
      <div className="history-content-main">
        <h2 className="text-3xl font-extrabold mb-6 text-gray-800 border-b-4 border-teal-500 pb-2">
          üßæ Á¢∫ÂÆöÊ∏à„ÅøÊ≥®ÊñáÂ±•Ê≠¥ (Êú™‰ºöË®à)
        </h2>

        {pendingOrders.length === 0 ? (
          <div className="empty-history-message">
            <p className="text-2xl text-gray-500 italic mt-10">
              „Åæ„Å†Á¢∫ÂÆö„Åó„Åü„ÅîÊ≥®Êñá„ÅØ„ÅÇ„Çä„Åæ„Åõ„Çì„ÄÇ
            </p>
            <p className="text-lg text-gray-400 mt-2">
              Ê≥®Êñá„Çø„Éñ„Åã„ÇâÂïÜÂìÅ„ÇíÈÅ∏„Å≥„ÄÅ„ÄåÊ≥®Êñá„ÇíÁ¢∫ÂÆö„Åô„Çã„Äç„ÇíÊäº„Åó„Å¶„Åè„Å†„Åï„ÅÑ„ÄÇ
            </p>
          </div>
        ) : (
          <div className="order-list-scroll">
            {pendingOrders.map((order) => (
              <div key={order.id} className="order-history-card">
                <div className="order-header-info">
                  <span className="order-id">Ê≥®Êñá **#{order.id}**</span>
                  <span className="order-timestamp">
                    {new Date(order.timestamp).toLocaleTimeString("ja-JP", {
                      hour: "2-digit",
                      minute: "2-digit",
                    })}{" "}
                    Á¢∫ÂÆö
                  </span>
                  <span className="order-total">
                    **¬•{order.totalAmount.toLocaleString()}**
                  </span>
                </div>
                <ul className="item-list">
                  {order.items.map((item: OrderItem) => (
                    <li key={item.id} className="item-detail">
                      <span>{item.name}</span>
                      <span className="quantity-price">
                        {item.quantity} ÁÇπ @ ¬•{item.price.toLocaleString()}
                      </span>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Âè≥ÂÅ¥: ÂêàË®àÈ°ç„Å®„Ç¢„ÇØ„Ç∑„Éß„É≥„Éú„Çø„É≥ (CSS„ÇØ„É©„Çπ 'history-summary-sidebar' „ÅßÂõ∫ÂÆöÂπÖ„Çµ„Ç§„Éâ„Éê„Éº„Å´) */}
      <div className="history-summary-sidebar">
        <h3 className="text-2xl font-bold mb-4 text-gray-700">Êú™‰ºöË®à ÂêàË®à</h3>
        <h1 className="text-6xl font-extrabold text-red-600 mb-8">
          ¬•{orderHistoryTotalAmount.toLocaleString()}
        </h1>

        {/* „Åä‰ºöË®à„Å´ÈÄ≤„ÇÄ„Éú„Çø„É≥ */}
        <button
          onClick={onGoToPaymentView}
          disabled={!isReadyToPay}
          className="py-4 px-6 bg-red-600 text-white rounded-xl text-xl font-bold hover:bg-red-700 transition shadow-lg w-full mb-4"
        >
          <span role="img" aria-label="money">
            üí≥
          </span>{" "}
          „Åä‰ºöË®à„Å´ÈÄ≤„ÇÄ
        </button>

        {/* „Çπ„Çø„ÉÉ„ÉïÂëº„Å≥Âá∫„Åó„Éú„Çø„É≥ */}
        <button
          onClick={onCallStaff}
          className="py-4 px-6 bg-yellow-500 text-gray-800 rounded-xl text-xl font-bold hover:bg-yellow-600 transition shadow-lg w-full"
        >
          <span role="img" aria-label="bell">
            üõéÔ∏è
          </span>{" "}
          „Çπ„Çø„ÉÉ„ÉïÂëº„Å≥Âá∫„Åó
        </button>
      </div>
    </div>
  );
};

export default OrderHistoryPane;
